description:
Всем привет, меня зовут Андрей, мне 32 года. 

Очередная попытка научиться играть в покер NL2 6max и выше. Стримы как средство для совместно обучения, мотивации и просто хорошего настроения. 
Также стримы  интересных игр. 

Каждый желающий может принять участие в развитии канала:
₽ Поддержка -- https://www.donationalerts.com/r/skillpin  (сообщение на экран) 


Правила для посетителей канала: 
1. Без оскорблений в чей-либо адрес;
2. Без мата;
3. Без рекламы, ссылок;
4. Без капса.

😄 Hi, I'm Hassan! - "Ripex".
🔧 The main focus of this channel is to help you optimize games on your Low-End PC.

✔️ Topics of Videos:
▪️ FPS Boost;
▪️ Fix Bugs and Issues;
▪️ Optimize Connection and Lower Ping / Latency.
